import {BrowserRouter, Route, Routes} from "react-router-dom";
import Home from "../components/home/Home";
import About from "../components/about/About";
import Contacts from "../components/contacts/Contacts";
import Dialogs from "../components/dialogs/Dialogs";
import Dialog from "../components/dialog/Dialog";
import {hasRole} from "../services/auth/auth";
import User from "../components/user/User";
import Admin from "../components/admin/Admin";

const MainPageRoutes = ({user}) => {
    return (
        <BrowserRouter>
            <Routes>
                <Route exact path='/' element={Home()}/>
                <Route path='/about' element={About({companyName: "Some Company"})}/>
                <Route path='/contacts' element={Contacts({year: 2022})}/>
                <Route path='/dialogs' element={Dialogs()}/>
                <Route path='/dialogs/:id' element={<Dialog/>}/>
                {hasRole(user, ['user']) && <Route path='/user' element={User}/>}
                {hasRole(user, ['admin']) && <Route path='/admin' component={Admin}/>}
            </Routes>
        </BrowserRouter>
    );
};

export default MainPageRoutes;
